import React from 'react';
import Maps from "./Maps";





class DetailWeather extends React.Component {

    state ={
         city_name : undefined,
         lat : undefined,
         lon : undefined
    }

    componentDidMount = async () => {        
        const city_name = this.props.city;
        const latitude = this.props.lat ;
        const longitide = this.props.lon;
    }
    if (city){
        this.setState({
            city_name : this.props.city,
            lat: this.props.lat,
            lon: this.props.lon
    });
    }
    
    render() {
        var lat = this.props.lat ;
        var lon = this.props.lon;
        var city =  this.props.city;           
        return (
        <div>
            <Maps className= "map_detail"
            id="myMap"
            options={{
              center: { lat: Number(lat), lng: Number(lon)},
              zoom: 2
            }}
            onMapLoad={map => {
              const marker = new window.google.maps.Marker({
                position: { lat: Number(lat), lng: Number(lon) },
                map: map,
                title: 'Hello!'                
              });
            }}
            />
        </div>
         
        );
    
    }
}

export default DetailWeather;
